import "./navbar.css"
function Navbar(){
    return(
        <div className="main-navbar">
            <div className="navbar">
                <a className="navbar-link first-link" href="/#about">About</a>
                <h2 className="navbar-head">SIGDI</h2>
                <a className="navbar-link" href="/contact">Contact</a>
            </div>
        </div>
    )
}
export default Navbar;
